                "Content-Type": "application/json",
                "x-api-key": "a1dd61b4-b654-4001-a4f4-5ec7c2386882"
            }
        })
            .then(response => {
                response.json().then(data => {
                    setCards(data[0].url);
                })
                    .catch(error => console.log(error))
            })

    }

    useEffect(() => {
        fetchData();
    }, [])
  return (
    <Button onClick={fetchData}>
  New Kitty
    </Button>
  );
}
